import React from "react";
import { Container, Row } from "react-bootstrap";
import "./NotesLandingPage.css";

const NotesLandingPage = () => {
  return (
    <div className="main">
      <Container>
        <Row>
          <div className="intro-text">
            <div>
              C
            </div>
          </div>
        </Row>
      </Container>
    </div>
  );
};

export default NotesLandingPage;
